import React from "react";
import ReactDom from "react-dom";
//import the css file below
//MAKE SURE TO CAPIYALIZE CONST NAMES OR IT WONT WORK
import "./index.css";

function BookList() {
  return (
    <div className="ttab">
      <Tab />
      <FirstTab />
      <Images />
    </div>
  );
}

const Tab = () => {
  return (
    <div className="tab">
      <button className="tabLink" onClick="openPage('Hi there')">
        Help
      </button>
      <button className="tabLink" onClick="Hi there">
        FAQ
      </button>
      <button className="tabLink" onClick="Hi there">
        Sign Up
      </button>
    </div>
  );
};
const Images = () => (
  <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSMCwg44g-XWEFebXYolmRI0rmP1yb4rqH6dQ&usqp=CAU"></img>
);

const FirstTab = () => <h1>Hi thereeeeeee</h1>;
ReactDom.render(<BookList></BookList>, document.getElementById("root"));
